        <h1 className="card-header">Students Module</h1>
        <div className="card-body">
          <div className="institution-name">
            <h1>Image container</h1>
          </div>

          <button
            onClick={() => {
              alert("hi");
            }}
            type="button"
          >
            Open
          </button>
        </div>
      </div>
    </>
  );
};

export default CreateTest;
